import React, { Component } from 'react';
import {dataService} from '../services/model-profile-service'

export default class ModelProfile extends Component {


    user = {}
    profileUser=  dataService.getData().subscribe(message => {
        this.user = message.value;
        console.log('message', this.user);
    });
     

    render() {

        
        return (
            <div className="wrapper">
                <p></p>
            <form>
                <div className="form-group">
                    <label>Enter Name</label>
                    <input type="text" className="form-control" />
                </div>
                <div className="form-group">
                    <label>Enter Email</label>
                    <input type="text" className="form-control" />
                </div>
                <div className="form-group">
                    <input type="submit" value="Create User" className="btn btn-success btn-block" />
                </div>
            </form>
        </div>
        )
    }
}
